import React from 'react'
import { getbrandsliderdata } from '../../API/Api'
import { GETBRANDSLIDERPRODUCT } from '../ActionType'

export const brandslideraction = (dispatch) => {
    console.log("first")

    getbrandsliderdata().then((res) => {
        console.log(res.data)
        dispatch({
            type: GETBRANDSLIDERPRODUCT,
            payload: res.data
        })
    }).catch(() => { console.log("having error") })
}
